import './App.css';

function App() {
  return (
    <div className="app-container">
      <h1>Welcome to WebLayers</h1>
      <p>This is a visualization of what happens when you click a link.</p>
      <img src="/diagram-placeholder.svg" alt="Layer Diagram" style={{ maxWidth: '100%' }} />
    </div>
  );
}

export default App;
